        </li>

        <li className="nav-item">
          <NavLink
            to="/"
            exact
            style={LinkStyles}
            activeStyle={LinkStyles} 
            className="nav-link" >Reviews
          </NavLink>
        </li>

      </ul>
    </div>
  </div>
</nav>
        </>
    )
}

export default Navbar;
